(10, 'Loạt video hướng dẫn học Java Web', 'http://khanhspring.com/wp-content/uploads/2015/06/java-web-tutorial.png', 'https://www.youtube.com/playlist?list=PL82tXMnARQXJWF1lx61MQYQnT0gX3hP2I', 'https://www.youtube.com/playlist?list=PL82tXMnARQXJWF1lx61MQYQnT0gX3hP2I', '[\"HTML\",\"CSS\",\"Javascript\",\"Java\"]', '1516527831', 'Cơ bản'),
(11, 'Bộ 3 khóa học SEO cơ bản, nâng cao, seo lên top cùng chuyên gia', 'http://www.aphelionsoftwares.com/img/seo-in-naples-fl.png', 'SEO (Viết tắt của từ Search Engine Optimization) là tập hợp các phương pháp tối ưu hóa nhằm mục đích giúp Website của bạn lên top 10 kết quả tìm kiếm. Nếu sản phẩm của bạn phù hợp với nhu cầu tìm kiếm của khách hàng, nhưng Web của bạn không hiển thị sản phẩm lên trang đầu của kết quả tìm kiếm, thì khả năng tiếp cận của khách hàng đến sản phẩm của bạn là rất thấp.\r\n\r\nVậy bạn muốn quảng bá sản phẩm của mình đến gần hơn với khách hàng? Bạn cần được đào tạo SEO.\r\n\r\nNhững khóa học trực tuyến  được phát hành nhằm cung cấp kiến thức về SEO cũng như cách SEO như thế nào là tốt nhất cho các học viên.', 'https://drive.google.com/drive/u/0/folders/0B4fU5__VXkIkak9vU01UOUl4OHM', '[\"SEO\"]', '1516527831', 'All Level'),
(12, 'Tài liệu học lập trình web cơ bản!', 'https://metroui.org.ua/images/css-logo.png', '<b>Trong Video bao gồm:</b>\n1. HTML – CSS\n2. HTML5 – CSS3\n3. jQuery\n4. Dựng giao diện bằng Bootstrap\n5. Lập trình Ajax\n6. Hướng Dẫn Cắt PSD sang HTML\n7. Lập trình PHP cơ bản\n8. Lập trình Nodejs', 'https://www.fshare.vn/file/7Z6K17M8149O#64z25313w2x2q2b4c4v203f4v22403w2', '[\"HTML\",\"CSS\",\"Javascript\",\"PHP\",\"NodeJS\",\"English\"]', '1516527831', 'Cơ bản'),
(13, 'Tài liệu lập trình web của CĐ FPT Polytechnic', 'http://vieclam.phanrangninhthuan.com/wp-content/uploads/2017/03/fpt-logo.jpg', 'https://drive.google.com/drive/folders/0B7pBLHa1wcvZbUR2OC1XY1hBTFU', 'https://drive.google.com/drive/folders/0B7pBLHa1wcvZbUR2OC1XY1hBTFU', '[\"HTML\",\"CSS\",\"Javascript\",\"PHP\",\"WEB\"]', '1516527831', 'All Level'),
(14, 'Chia sẻ tài liệu học lập trình Android/Kotlin', 'https://tokbox.com/blog/wp-content/uploads/2017/05/Android-and-Kotlin.jpg', 'List tài liệu\r\n- 2d-zombies-game-android-ios\r\n- android-and-ios-apps-for-wordpress-blog\r\n- android-apps-reskinning-for-fun-and-profit (2 part)\r\n- android-lollipop-complete-development-course (5 part)\r\n- android-programming-for-beginners\r\n- android-smartherd (13 part)\r\n- android-tutorial-from-beginner-to-professional (2 Part)\r\n- Android App Development Easy and Quick Programming\r\n- The Complete Android Developer Course\r\n- Khóa học Kotlin của anh Thanh', 'https://googleunlimitedstore-my.sharepoint.com/personal/linuxteamvietnam_googleunlimited_com/Documents/Forms/All.aspx?slrid=578d329e-509d-4000-c59f-4a0a8df86fcd&RootFolder=%2Fpersonal%2Flinuxteamvietnam_googleunlimited_com%2FDocuments%2FAndroid&FolderCTID', '[\"Android\"]', '1516527831', 'Cơ bản'),
(15, 'Bộ video về kỹ năng viết CV và dự phỏng vấn', 'http://freevector.co/wp-content/uploads/2010/06/52762-job-search-symbol-of-a-hand-holding-cv.png', 'Bộ video về kỹ năng viết CV và dự phỏng vấn', 'https://drive.google.com/drive/folders/0B63PO_GvXznLV3d5N3RaeXZNdlk', '[\"WEB\"]', '1516527831', 'All Level'),
(16, '[HOT] Tài liệu tổng hợp toàn bộ mọi thứ về lập trình', 'https://pbs.twimg.com/profile_images/1880442150/Hot_Logo_red.jpg', 'Academy: AI, Big Data, KH máy tính, Thuật toán, Thiết kế, Lập trình, Software -Engineering\r\n\r\nLink: https://drive.google.com/open?id=0B42wsjSbxHg8d0hmcmJxNGFnM2c\r\n\r\n*** C-Named: Tuyển tập toàn bộ tài liệu về lập trình C, C++, C#\r\n\r\nLink: https://drive.google.com/open?id=0B42wsjSbxHg8MWQxaFVyQmx1eU0\r\n\r\n***  DevLife: Tài liệu về bí quyết thành công trong cuộc sống mà mọi Dev cần có\r\n\r\nLink: https://drive.google.com/open?id=0B42wsjSbxHg8YnA2SVozTGJ6dVU\r\n\r\n***  Embedded: Lập trình mã nhúng - Assembly\r\n\r\nLink: https://drive.google.com/open?id=0B42wsjSbxHg8WTExdEpBdWRISDA\r\n\r\n***  Functional: Lập trình hàm - Scala, Haskell, Java, Javascript\r\n\r\nLink: https://drive.google.com/open?id=0B42wsjSbxHg8Y0dwS1lxcjBWUFE\r\n\r\n***  Hacking: Hack, tấn công và bảo mật\r\n\r\nLink: https://drive.google.com/open?id=0B42wsjSbxHg8MVAwZ19NbExveEE\r\n\r\n***  Java: Lập trình Java\r\n\r\nLink: https://drive.google.com/open?id=0B42wsjSbxHg8aUNmOUtIQldOczQ\r\n\r\n***  Microsoft\r\n\r\nLink: https://drive.google.com/open?id=0B42wsjSbxHg8U3owUVRiRWdvQ28\r\n\r\n***  Pascal: Tài liệu về lập trình Pascal\r\n\r\nLink: https://drive.google.com/open?id=0B42wsjSbxHg8SkFSanpGWlJJYkU\r\n\r\n***  Phone: Lập trình mobile - Android, IOS\r\n\r\nLink: https://drive.google.com/open?id=0B42wsjSbxHg8QVZXa1NMSC1kLTQ\r\n\r\n***  Scripting: Python, Perl, Ruby\r\n\r\nLink: https://drive.google.com/open?id=0B42wsjSbxHg8NEwzSFA1WVFOa2M\r\n\r\n***  VB: Lập trình Visual Basic \r\n\r\nLink: https://drive.google.com/open?id=0B42wsjSbxHg8UmVzVVVlZlQxeEE\r\n\r\n***  WebDev: Lập trình nền tảng web - Front-End, Back-End\r\n\r\nLink: https://drive.google.com/open?id=0B42wsjSbxHg8UDhTVnNyUXBGcDA', 'https://drive.google.com/open?id=0B42wsjSbxHg8NEwzSFA1WVFOa2M', '[\"Android\",\"Python\",\"WEB\",\"Photoshop\"]', '1516527831', ''),
(17, 'Chia sẽ nhiều khóa học lập trình hay', 'https://www.androidcentral.com/sites/androidcentral.com/files/styles/large/public/topic_images/2015/android-apps-topic.png?itok=gRZTqteM&timestamp=1444304563', 'Chia sẽ nhiều khóa học lập trình hay như WEB, Android, PTS, ...', 'https://drive.google.com/drive/u/0/folders/0B4fU5__VXkIkUmZ4WV9jTEFzcTQ', '[\"PHP\",\"Android\",\"SEO\",\"WEB\",\"Photoshop\"]', '1516527831', 'All Level'),
(18, 'Share các khóa học tại Edumall', 'https://www.giamgiachotui.com/wp-content/themes/wp-coupon-child-master/images/store/edumall.png', 'Trong thời gian Download rãnh thì đọc bài review của mềnh nhé thấy đúng thì share cho mọi người biết thông tin thêm để tránh bị lừa ', 'https://drive.google.com/drive/u/0/folders/0B4fU5__VXkIkNmtBQW9fRE1peDA', '[\"PHP\",\"Angular\",\"Java\",\"Android\",\"Github\",\"WEB\"]', '1516527831', 'All Level'),
(19, 'Tài nguyên FPT Book', 'https://caodang.fpt.edu.vn/wp-content/uploads/2013/11/MG_9104-retouch.jpg', 'tài nguyên và khóa học về full bộ adobe nhé, có cả lập trinh game,lập trình web với html5 vs css3 và PHP vs MySQL Của fpt book', 'https://drive.google.com/drive/folders/1M58BNPgVJ26n0LaFzxzHZ_g_vDrnsjEF', '[\"HTML\",\"CSS\",\"PHP\",\"Photoshop\"]', '1516527831', 'All Level');
