INSERT INTO `post` (`id`, `title`, `url`, `category`, `datetime`, `image`, `tomtat`, `content`, `trend`) VALUES
(120, 'Facebook sắp cho chúng ta tự quyết định News Feed sẽ hiển thị những gì không', 'Facebook-sap-cho-chung-ta-tu-quyet-dinh-News-Feed-se-hien-thi-nhung-gi', 'English', '1516444799', 'http://localhost/blogver2/files/post/photo1516427069739-1516427069739.jpg', 'Các tin rác sẽ ít có cơ hội hiện lên hơn, nhưng những tin được chúng ta chọn chắc gì đã là đúng đắn và hợp với tiêu chuẩn chung?', '                                                                                                                                                                                                    <p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\"><a class=\"seo-suggest-link\" href=\"http://kenh14.vn/facebook.html\" target=\"_blank\" title=\"facebook\" style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\">Facebook</a> mới đây đã chính thức cho biết, họ sẽ sớm chọn lọc nội dung hiển thị trên News Feed theo \"độ tin tưởng và ưa thích\" do chính người dùng đánh giá.</p><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\">Như vậy, tình trạng Facebook tự đánh giá các luồng thông tin và tự động đưa nó lên News Feed của từng người sẽ không còn nữa, vì dần dần chính việc chúng ta lựa chọn các tin tức tiếp xúc xung quanh sẽ hình thành nên đủ dữ liệu để Facebook dựa vào mà hỗ trợ chọn tin ưu tiên cùng.</p><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\">Đó cũng chính là nội dung mà Mark Zuckerberg đã viết trong chính bài đăng lên trang thông báo Facebook. Tuy vậy, vẫn còn đó một vài ý kiến cho rằng nó không hoàn toàn đúng đắn, vì biết đâu những thông tin mà chúng ta cho là \"đáng tin\" đó lại không hề chính xác và chuẩn theo những gì đáng được ghi nhận?</p><div class=\"VCSortableInPreviewMode active\" type=\"Photo\" style=\"margin-right: auto; margin-bottom: 25px; margin-left: auto; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: inherit; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; text-align: center; width: 620px; box-sizing: border-box; color: rgb(34, 34, 34);\"><div style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\"><a href=\"https://kenh14cdn.com/2018/photo-1-1516426924183.jpg\" data-fancybox-group=\"img-lightbox\" title=\"News Feed đang được chăm chút để trở nên xứng đáng, ý nghĩa hơn.\" target=\"_blank\" class=\"detail-img-lightbox\" style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box; cursor: zoom-in; display: block;\"><img src=\"https://kenh14cdn.com/2018/photo-1-1516426924183.jpg\" id=\"img_a5f8f670-fda4-11e7-841a-b3e5f0d89b2b\" w=\"1200\" h=\"628\" alt=\"Facebook sắp cho chúng ta tự quyết định News Feed sẽ hiển thị những gì - Ảnh 1.\" title=\"Facebook sắp cho chúng ta tự quyết định News Feed sẽ hiển thị những gì - Ảnh 1.\" rel=\"lightbox\" photoid=\"a5f8f670-fda4-11e7-841a-b3e5f0d89b2b\" type=\"photo\" data-original=\"https://kenh14cdn.com/2018/photo-1-1516426924183.jpg\" width=\"\" height=\"\" class=\"lightbox-content\" style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: bottom; color: transparent; box-sizing: border-box; display: block; width: 620px; max-width: 100%;\"></a></div><div class=\"PhotoCMS_Caption\" style=\"padding: 10px; border: 0px; font-style: italic; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; background: rgb(242, 242, 242); text-align: left; box-sizing: border-box;\"><p data-placeholder=\"[nhập chú thích]\" class=\"\" style=\"border: 0px; font-style: normal; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: 18px; font-family: SFD-Medium; vertical-align: baseline; box-sizing: border-box; color: rgb(102, 102, 102); -webkit-font-smoothing: subpixel-antialiased; margin-bottom: 0px !important;\">News Feed đang được chăm chút để trở nên xứng đáng, ý nghĩa hơn.</p></div></div><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\">Cách đây không lâu, Facebook cũng đã cho biết sẽ hạn chế bài đăng từ các doanh nghiệp, Fanpage để hiển thị nhiều hơn trạng thái của bạn bè, người thân. Mark Zuckerberg gọi đây là một bước tiến để thúc đẩy nhiều tương tác ý nghĩa hơn. <i style=\"border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\">\"Chúng tôi cảm thấy cộng đồng này không phải lập ra để dùng cho vui là chính, mà phải mang lại lợi ích thực sự đến cho mọi người,\"</i> Mark phát biểu.</p><div id=\"admzone474524\" style=\"border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: inherit; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; clear: both; color: rgb(34, 34, 34);\"><div id=\"ads_zone474524\" style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\"><div id=\"ads_zone474524_slot1\" style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\"></div></div></div><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\"><i style=\"border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\">\"Giờ chúng tôi cũng đang gặp khó khăn trong việc thay đổi cách hiển thị và sắp xếp tin tức cho phù hợp nhất với mọi người, nhưng sẽ không phải lúc tự quyết định hết nữa vì nó không đúng lắm so với thời điểm hiện tại. Thay vào đó, chúng tôi sẽ nhờ đến chính người dùng các bạn để đưa ra lựa chọn xem muốn được nhìn thấy những thông tin như thế nào.\"</i></p>                                                                                                                                                                        ', 'true');
INSERT INTO `post` (`id`, `title`, `url`, `category`, `datetime`, `image`, `tomtat`, `content`, `trend`) VALUES
(118, 'Không phải Harvard, đây mới là trường đại học tốt nhất thế giới 2018', 'Khong-phai-Harvard,-day-moi-la-truong-dai-hoc-tot-nhat-the-gioi-2018', 'News', '1516444633', 'http://localhost/blogver2/files/post/cambridge-1516435374713.jpg', 'Theo bảng xếp hạng đại học thế giới năm 2018 của Times Higher Education, trong 14 năm, lần đầu tiên 2 vị trí đầu tiên trong xếp hạng những trường đại học tốt nhất thế giới không thuộc về Mỹ.', '                            <p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\"><span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\">Tạp chí giáo dục hàng đầu của Anh - Times Higher Education (THE) - công bố bảng xếp hạng các trường đại học hàng đầu thế giới năm 2018. Theo đó, Đại học Oxford (Anh) tiếp tục nắm giữ vị trí đầu bảng năm thứ 2 liên tiếp. Các tiêu chí xếp hạng bao gồm giảng dạy, nghiên cứu, chuyển nhượng kiến thức, thành tích, đánh giá quốc tế và thu nhập.</span><br style=\"box-sizing: border-box;\"></p><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\"><span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\">Đại học Cambridge đã vượt lên từ vị trí số 4 lên số 2 bởi thu nhập và chất lượng nghiên cứu của trường tăng rõ rệt. </span><span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\">Trong 14 năm, lần đầu tiên Vương quốc Anh có 2 trường đứng đầu trong bảng xếp hạng. </span></p><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\"><span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\">Đại học Harvard của Mỹ tụt xuống vị trí thứ sáu. </span><span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\">Ngôi trường Ivy League danh giá này đã đào tạo ra các sinh viên xuất sắc, với hơn 45 người đạt giải Nobel, 48 người giành giải Pulitzer và nhiều người làm lãnh đạo quốc gia. </span></p><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\"><span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\">Thu nhập của trường đại học ở Mỹ giảm lần lượt là 23% và 24%, trong khi đó, Cambridge và Oxford lại tăng lần lượt là 11% và 24%.</span></p><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\">Đồng hạng 3 là 2 trường của Mỹ gồm Viện Công nghệ California và Đại học Stanford. Viện Công nghệ California (thường gọi Caltech) là cơ sở nghiên cứu và giáo dục khoa học, kỹ thuật nổi tiếng thế giới. Còn Standford lại là một trong những trường có khuôn viên rộng nhất ở Mỹ và là một trong các đại học uy tín nhất thế giới.</p><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\">Dưới đây là danh sách bảng xếp hạng các trường đại học tốt nhất thế giới 2018</p><h3 style=\"margin-bottom: 22px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: inherit; font-stretch: inherit; font-size: 26px; line-height: 30px; font-family: SFD-Bold; vertical-align: baseline; box-sizing: border-box; color: rgb(17, 17, 17); width: 620px;\">1. Đại học Oxford (Anh)</h3><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\">Sinh viên: 20.409</p><p style=\"