INSERT INTO `post` (`id`, `title`, `url`, `category`, `datetime`, `image`, `tomtat`, `content`, `trend`) VALUES
(119, 'Đây chính là nguyên nhân vì sao học sinh luôn ', 'Day-chinh-la-nguyen-nhan-vi-sao-hoc-sinh-luon-', 'English', '1516444721', 'http://localhost/blogver2/files/post/photo-1-1516186418519.jpg', 'Ngồi bàn đầu thường xuyên mất bút, mấy thầy cô mượn bút kí sổ đầu bài rồi quên luôn, gần 3 năm cấp 3 này mất gần mười mấy cây bút bi xanh đỏ tím đen. Tôi như cái tiệm tạp hóa thu nhỏ!', '                            <p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\"><span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\">1. Bàn đầu là khi bạn luôn là người bầu bạn nói chuyện với giáo viên mỗi khi cuối tiết, phải rặn nói khi giáo viên hỏi, là điểm nhìn đầu tiên... Là nơi không dám ngáp, không dám hé mồm, không dám quay xuống, không dám ngủ, không dám ăn vụng, thiệt thòi đủ thứ so với mấy đứa phía sau.</span><br style=\"box-sizing: border-box;\"></p><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\">2. Nhiều hôm buồn ngủ mà không dám gục mặt xuống bàn. Trời nắng thì đen, trời lạnh thì thôi khỏi nói rồi. Làm gì cũng lén lút, thật sự khổ tâm!<br style=\"box-sizing: border-box;\"></p><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\">3. \"Hôm trước học đến đâu rồi?\" nói xong là cô xuống lấy tập mình coi, ngày nào cũng phải chép bài đầy đủ, không chép đủ hay quên là lại sợ cô xuống xem mà không có. Cho cô mượn viết, cho cô mượn tài liệu, xếp bài lại giùm cô, thầy cô nhờ gì cũng là đứa bàn nhất làm.</p><div class=\"VCSortableInPreviewMode noCaption\" type=\"Photo\" style=\"margin-right: auto; margin-bottom: 25px; margin-left: auto; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: inherit; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; text-align: center; width: 620px; box-sizing: border-box; color: rgb(34, 34, 34);\"><div style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\"><a href=\"https://kenh14cdn.com/2018/photo-1-1516186418519.jpg\" data-fancybox-group=\"img-lightbox\" title=\"\" target=\"_blank\" class=\"detail-img-lightbox\" style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box; cursor: zoom-in; display: block;\"><img src=\"https://kenh14cdn.com/2018/photo-1-1516186418519.jpg\" id=\"img_ad43cf90-fb74-11e7-90cb-ed43cff135c4\" w=\"800\" h=\"447\" alt=\"Đây chính là nguyên nhân vì sao học sinh luôn né vị trí ngồi bàn đầu - Ảnh 1.\" title=\"Đây chính là nguyên nhân vì sao học sinh luôn né vị trí ngồi bàn đầu - Ảnh 1.\" rel=\"lightbox\" photoid=\"ad43cf90-fb74-11e7-90cb-ed43cff135c4\" type=\"photo\" data-original=\"https://kenh14cdn.com/2018/photo-1-1516186418519.jpg\" width=\"\" height=\"\" class=\"lightbox-content\" style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: bottom; color: transparent; box-sizing: border-box; display: block; width: 620px; max-width: 100%;\"></a></div></div><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\"><span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\">4. Giáo viên: \"Mấy em học không đàng hoàng, gian lận trong thi cử nên chủ nhiệm cho ngồi bàn đầu đúng không?\"</span><br style=\"box-sizing: border-box;\"></p><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\">Tôi: \"...\"</p><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\">Giáo viên: \"Tôi sẽ quan tâm đặc biệt đến mấy em\" *nụ cười thân thiện*</p><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\">Tôi: \"...\"</p><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\">5. Tôi ngồi bàn đầu từ kì 2 lớp 8 đến giờ. Hai năm, lúc nào cũng bị giáo viên lấy vở ra kiểm tra, bê đồ thí nghiệm cũng là tôi, có cảm giác như là học sinh được giáo viên nhìn nhiều nhất. Lớp mất trật tự, giáo viên dựa vào cái bàn học yêu quý của tôi chửi oang oang, kết quả tôi là đứa lĩnh hậu quả nhiều nhất.</p><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\">6. Giơ tay giáo viên không gọi, không giơ tay giáo viên lại gọi? Và đừng mơ tưởng đến việc quay cóp. Ừ thì vì tôi là một trong những thành phần lùn nhất trong lớp mà. Đương nhiên tôi \"được\" ngồi bàn đầu rồi!</p><div class=\"VCSortableInPreviewMode noCaption\" type=\"Photo\" style=\"margin-right: auto; margin-bottom: 25px; margin-left: auto; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: inherit; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; text-align: center; width: 620px; box-sizing: border-box; color: rgb(34, 34, 34);\"><div style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\"><a href=\"https://kenh14cdn.com/2018/photo-1-1516186490472.jpg\" data-fancybox-group=\"img-lightbox\" title=\"\" target=\"_blank\" class=\"detail-img-lightbox\" style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box; cursor: zoom-in; display: block;\"><img src=\"https://kenh14cdn.com/2018/photo-1-1516186490472.jpg\" id=\"img_d7960240-fb74-11e7-bbe4-d5a453e11e72\" w=\"564\" h=\"451\" alt=\"Đây chính là nguyên nhân vì sao học sinh luôn né vị trí ngồi bàn đầu - Ảnh 2.\" title=\"Đây chính là nguyên nhân vì sao học sinh luôn né vị trí ngồi bàn đầu - Ảnh 2.\" rel=\"lightbox\" photoid=\"d7960240-fb74-11e7-bbe4-d5a453e11e72\" type=\"photo\" data-original=\"https://kenh14cdn.com/2018/photo-1-1516186490472.jpg\" width=\"\" height=\"\" class=\"lightbox-content\" style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: bottom; color: transparent; box-sizing: border-box; display: block; width: 620px; max-width: 100%;\"></a></div></div><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\"><span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\">7. </span><span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\">Ngồi bàn đầu phải luôn thật tỉnh táo và học hành chăm ngoan. Mỗi lần cô kiểm tra vở bài tập thì kiểm tra mỗi tôi đầu tiên, nếu làm thì không sao, nếu chưa làm thì y như rằng phán cả lớp hôm nay chưa làm bài tập. Còn trong giờ học hay lại gần đọc sách của tôi, tôi mà lơ tơ mơ không chú ý thì lại bảo: \"Ơ hay, cái lớp này học hay nhề, cô nói mà không chú ý là sao\". Ngồi bàn đầu là trọng trách cao cả, là bộ mặt của cả lớp, cố lên!</span></p><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\"><span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\">8. </span><span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\">Ngồi bàn đầu, gần cái quạt suốt ngày đứa thì réo \"bật đi mày ơi\", \"ê bật lên\" đứa thì \"bật làm chi\".</span><span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\"> Muốn tôi </span>sống sao!!!</p><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\">9. Cả lớp ăn hướng dương, có mình tôi bị ghi sổ đầu bài vì ngồi bàn đầu. Chán, không còn gì để nói.<span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\"><br style=\"box-sizing: border-box;\"></span></p><div id=\"admzone474524\" style=\"border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: inherit; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; clear: both; color: rgb(34, 34, 34);\"><div id=\"ads_zone474524\" style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\"></div></div><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\"><span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\">10. </span><span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\">Ngồi bàn đầu thì mất bút, mấy thầy cô mượn bút kí sổ đầu bài rồi quên luôn, gần 3 năm cấp 3 này mất gần mười mấy cây bút bi xanh đỏ tím đen. </span><span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\">Tôi như cái tiệm tạp hóa thu nhỏ!</span></p><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\"><span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\">11. Đã từng ngồi bàn đầu và có những trải nghiệm như thế này:</span></p><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\"><span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\">Em bàn đầu - cho tôi mượn vở.</span></p><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\"><span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\">Em bàn đầu - không nói chuyện.</span></p><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\"><span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\">Em bàn đầu - chép bài đầy đủ...</span></p>                        ', ''),
(126, 'VueJS & ReactJS – Những chỉ số mới nhất', 'VueJS-&-ReactJS-–-Nhung-chi-so-moi-nhat', 'Javascript', '1516458323', 'http://localhost/blogver2/files/post/photo5a63511755895.png', 'Trong khi đó, Reactjs là một thư viện Javascript dùng để xây dựng giao diện người dùng, và được sử dụng rất nhiều trong thời gian gần đây trong các dự án single-page application.', '<p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\">Hiện nay,&nbsp;<a href=\"https://techtalk.vn/\" data-wpel-link=\"internal\" style=\"box-sizing: border-box; color: rgb(236, 31, 39);\">Vue.js</a>&nbsp;là một trong những framework JavaScript tốt nhất và nhiều người cho rằng Vue sẽ dần thay thế cho Angular và React trong tương lai. Xét vòng đời của mình, Vue.js không&nbsp;mới hơn hay phổ biến hơn so với những frameworks&nbsp;khác nhưng vẫn sở hữu những yếu tố tạo nên sự khác biệt.</p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\">Trong khi đó, Reactjs là một thư viện Javascript dùng để xây dựng giao diện người dùng, và được sử dụng rất nhiều trong thời gian gần đây trong các dự án single-page application.</p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\">Vậy, Vue.js có thực sự tốt hơn so với Angular hay React không? Cùng xem qua 1 vài số liệu và so sánh mới nhất trên thị trường mà&nbsp;<strong style=\"box-sizing: border-box; font-weight: bold;\">anh Việt Trần – CTO của Skylab</strong>&nbsp;chia sẻ tại&nbsp;<a href=\"https://vietnamwebsummit.com/\" data-wpel-link=\"external\" target=\"_new\" style=\"box-sizing: border-box; color: rgb(236, 31, 39);\"><strong style=\"box-sizing: border-box; font-weight: bold;\">Vietnam Web Summit 2017</strong></a>&nbsp;ở Tp.HCM vừa qua.</p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\">Theo thống kê, tính đến thời gian 18/11/2017 thì số lượng Star của VueJS/ Vue đã đạt 74103, Facebook/ React đã cán mốc 81402. Ngược lại, về lượt tải của React xấp xỉ 1,8 triệu/ năm trong khi Vue chỉ ở mức hơn 200 ngàn/ năm.</p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\"><img class=\"alignnone size-full wp-image-25304\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/stat.png\" alt=\"\" width=\"1020\" height=\"198\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/stat.png 1020w, https://static.techtalk.vn/wp-content/uploads/2017/12/stat-300x58.png 300w, https://static.techtalk.vn/wp-content/uploads/2017/12/stat-768x149.png 768w, https://static.techtalk.vn/wp-content/uploads/2017/12/stat-696x135.png 696w\" sizes=\"(max-width: 1020px) 100vw, 1020px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; margin-top: 6px; margin-right: 10px; display: inline-block;\"></p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\">Anh Việt Trần cũng phác họa&nbsp;bức tranh tổng thể về Vue &amp; React thông qua bài toán thực tiễn, dễ hình dung là xây dựng danh sách Shopping trong 2 trường hợp: không có React/Vue &amp; có React/Vue.</p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51); text-align: center;\"><img class=\"alignnone size-full wp-image-25309\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist-1.png\" alt=\"\" width=\"1072\" height=\"778\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist-1.png 1072w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist-1-300x218.png 300w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist-1-768x557.png 768w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist-1-1024x743.png 1024w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist-1-324x235.png 324w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist-1-696x505.png 696w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist-1-1068x775.png 1068w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist-1-579x420.png 579w\" sizes=\"(max-width: 1072px) 100vw, 1072px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; margin-top: 6px; margin-right: 10px; display: inline-block;\"><span style=\"box-sizing: border-box; font-size: 8pt;\">Khi không có Vue/React</span></p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\"><img class=\"alignnone size-full wp-image-25310\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist1-1.png\" alt=\"\" width=\"1013\" height=\"717\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist1-1.png 1013w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist1-1-300x212.png 300w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist1-1-768x544.png 768w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist1-1-100x70.png 100w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist1-1-696x493.png 696w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist1-1-593x420.png 593w\" sizes=\"(max-width: 1013px) 100vw, 1013px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; margin-top: 6px; margin-right: 10px; display: inline-block;\"></p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51); text-align: center;\"><span style=\"box-sizing: border-box; font-size: 8pt;\">Khi có React/Vue thì mọi thứ đều là Virtudal DOM/ Component</span></p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\">Như vậy, mô hình Component trong React &amp; Vue có thể được khái quát như sau:</p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\"><img class=\"alignnone size-full wp-image-25307\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/componentReact-1.png\" alt=\"\" width=\"993\" height=\"436\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/componentReact-1.png 993w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentReact-1-300x132.png 300w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentReact-1-768x337.png 768w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentReact-1-696x306.png 696w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentReact-1-957x420.png 957w\" sizes=\"(max-width: 993px) 100vw, 993px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; margin-top: 6px; margin-right: 10px; display: inline-block;\"></p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51); text-align: center;\"><span style=\"box-sizing: border-box; font-size: 8pt;\">Component trong React</span><img class=\"alignnone size-full wp-image-25308\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/componentVue-1.png\" alt=\"\" width=\"1317\" height=\"709\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/componentVue-1.png 1317w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentVue-1-300x162.png 300w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentVue-1-768x413.png 768w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentVue-1-1024x551.png 1024w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentVue-1-696x375.png 696w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentVue-1-1068x575.png 1068w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentVue-1-780x420.png 780w\" sizes=\"(max-width: 1317px) 100vw, 1317px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; margin-top: 6px; margin-right: 10px; display: inline-block;\"><br style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 8pt;\">Component trong Vue</span></p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\"><a href=\"https://meetup.vn/detail/FRONTEND-NIGHT---NIGHT-OF-REACT-VUE-WEB-LAYOUT-AND-OPTIMIZATION-210\" data-wpel-link=\"external\" target=\"_new\" style=\"box-sizing: border-box; color: rgb(236, 31, 39);\"><img class=\"size-full wp-image-26007 aligncenter\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/event-frontend-night.png\" alt=\"\" width=\"1200\" height=\"628\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/event-frontend-night.png 1200w, https://static.techtalk.vn/wp-content/uploads/2017/12/event-frontend-night-300x157.png 300w, https://static.techtalk.vn/wp-content/uploads/2017/12/event-frontend-night-768x402.png 768w, https://static.techtalk.vn/wp-content/uploads/2017/12/event-frontend-night-1024x536.png 1024w, https://static.techtalk.vn/wp-content/uploads/2017/12/event-frontend-night-696x364.png 696w, https://static.techtalk.vn/wp-content/uploads/2017/12/event-frontend-night-1068x559.png 1068w, https://static.techtalk.vn/wp-content/uploads/2017/12/event-frontend-night-803x420.png 803w\" sizes=\"(max-width: 1200px) 100vw, 1200px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; text-align: center; clear: both; display: block; margin: 6px auto 21px;\"></a></p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\">Đặc biệt, React &amp; Vue cũng sở hữu những điểm khác biệt đáng kể trên nhiều khía cạnh: Create a component, Updating &amp; events, Passing events to children, Two-way data binding, App state for shopping list, Render with iterating, State management.</p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51); text-align: center;\"><img class=\"size-full wp-image-25311 aligncenter\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/create1.png\" alt=\"\" width=\"1185\" height=\"1047\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/create1.png 1185w, https://static.techtalk.vn/wp-content/uploads/2017/12/create1-300x265.png 300w, https://static.techtalk.vn/wp-content/uploads/2017/12/create1-768x679.png 768w, https://static.techtalk.vn/wp-content/uploads/2017/12/create1-1024x905.png 1024w, https://static.techtalk.vn/wp-content/uploads/2017/12/create1-696x615.png 696w, https://static.techtalk.vn/wp-content/uploads/2017/12/create1-1068x944.png 1068w, https://static.techtalk.vn/wp-content/uploads/2017/12/create1-475x420.png 475w\" sizes=\"(max-width: 1185px) 100vw, 1185px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; clear: both; display: block; margin: 6px auto 21px;\"><span style=\"box-sizing: border-box; font-size: 8pt;\">Create a component in React</span><br style=\"box-sizing: border-box;\"><img class=\"size-full wp-image-25312 aligncenter\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/create2.png\" alt=\"\" width=\"1378\" height=\"732\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/create2.png 1378w, https://static.techtalk.vn/wp-content/uploads/2017/12/create2-300x159.png 300w, https://static.techtalk.vn/wp-content/uploads/2017/12/create2-768x408.png 768w, https://static.techtalk.vn/wp-content/uploads/2017/12/create2-1024x544.pn