static.techtalk.vn/wp-content/uploads/2017/12/rendervue-532x420.png 532w\" sizes=\"(max-width: 1023px) 100vw, 1023px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; margin-top: 6px; margin-right: 10px; display: inline-block;\"><span style=\"box-sizing: border-box; font-size: 8pt;\">App State for Shopping List</span></p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\">Xét về Performance về Duration in Miliseconds &amp; Memory size, ta lại có những thông số đáng xem xét như:</p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\"><img class=\"alignnone size-full wp-image-25305\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/performance.png\" alt=\"\" width=\"691\" height=\"1305\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/performance.png 691w, https://static.techtalk.vn/wp-content/uploads/2017/12/performance-159x300.png 159w, https://static.techtalk.vn/wp-content/uploads/2017/12/performance-542x1024.png 542w, https://static.techtalk.vn/wp-content/uploads/2017/12/performance-222x420.png 222w\" sizes=\"(max-width: 691px) 100vw, 691px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; margin-top: 6px; margin-right: 10px; display: inline-block;\"><img class=\"alignnone size-full wp-image-25306\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/performance1.png\" alt=\"\" width=\"692\" height=\"281\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/performance1.png 692w, https://static.techtalk.vn/wp-content/uploads/2017/12/performance1-300x122.png 300w\" sizes=\"(max-width: 692px) 100vw, 692px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; margin-top: 6px; margin-right: 10px; display: inline-block;\"></p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51); text-align: right;\"><em style=\"box-sizing: border-box;\"><strong style=\"box-sizing: border-box; font-weight: bold;\">Nguồn:&nbsp;<a href=\"http://techtalk.vn/\" data-wpel-link=\"external\" target=\"_new\" style=\"box-sizing: border-box; color: rgb(236, 31, 39);\">Techtalk</a>&nbsp;via&nbsp;<a href=\"http://blog.topdev.vn/\" data-wpel-link=\"external\" target=\"_new\" style=\"box-sizing: border-box; color: rgb(236, 31, 39);\">TopDev</a></strong></em></p>', 'true'),
(121, 'Hãng smartphone cao cấp Trung Quốc khiến 40.000 khách hàng bị lừa tiền chỉ vì lười sửa website cũ', 'Hang-smartphone-cao-cap-Trung-Quoc-khien-40.000-khach-hang-bi-lua-tien-chi-vi-luoi-sua-website-cu', 'News', '1516444870', 'http://localhost/blogver2/files/post/photo1516424868652-1516424868652.jpg', 'Thường ra mắt những sản phẩm smartphone cấu hình rất cao mà lại giá thành phải chăng, nhưng có vẻ như danh tiếng đó không đi đôi với sự cầu toàn trong mọi thứ.', '                                                        <p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\">Có vẻ như mọi thứ đang dần trở nên nóng lên và \"loạn cào cào\" đối với 40.000 khách hàng của thương hiệu smartphone OnePlus đến từ Trung Quốc. Không phải vì họ đang nóng lòng chờ đến tháng 6 mới được chứng kiến phiên bản OnePlus 6 mạnh mẽ đâu, mà là bởi vì website của công ty vừa bị hack và số tiền đang xử lý từ thẻ tín dụng của họ đã gần như không cánh mà bay hết.</p><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\">Cụ thể, theo như công bố chính thức mới đây từ chính OnePlus, một đoạn mã độc đã được cài vào trang thanh toán điện tử để lần ra các thông tin bảo mật cá nhân của các thẻ tín dụng dùng trong thao tác trả phí. Và diện người dùng bị ảnh hưởng có thể kéo dài từ suốt tầm giữa tháng 11 cho tới nay nếu không may có giao dịch vào khoảng thời gian đó.</p><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\">OnePlus đã có gửi mail đến những ai bị nghi vấn là nạn nhân để cảnh báo nhằm tránh mọi người làm gì dại dột và dễ bị tấn công hơn vì lộ thông tin.</p><div class=\"VCSortableInPreviewMode active noCaption\" type=\"Photo\" style=\"margin-right: auto; margin-bottom: 25px; margin-left: auto; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: inherit; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; text-align: center; width: 620px; box-sizing: border-box; color: rgb(34, 34, 34);\"><div style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\"><a href=\"https://kenh14cdn.com/2018/photo-1-1516423422228.jpg\" data-fancybox-group=\"img-lightbox\" title=\"\" target=\"_blank\" class=\"detail-img-lightbox\" style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box; cursor: zoom-in; display: block;\"><img src=\"https://kenh14cdn.com/2018/photo-1-1516423422228.jpg\" id=\"img_7eb20190-fd9c-11e7-8198-b3f43f7dc39b\" w=\"950\" h=\"534\" alt=\"Hãng smartphone cao cấp Trung Quốc khiến 40.000 khách hàng bị lừa tiền chỉ vì lười sửa website cũ - Ảnh 1.\" title=\"Hãng smartphone cao cấp Trung Quốc khiến 40.000 khách hàng bị lừa tiền chỉ vì lười sửa website cũ - Ảnh 1.\" rel=\"lightbox\" photoid=\"7eb20190-fd9c-11e7-8198-b3f43f7dc39b\" type=\"photo\" data-original=\"https://kenh14cdn.com/2018/photo-1-1516423422228.jpg\" width=\"\" height=\"\" class=\"lightbox-content\" style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: bottom; color: transparent; box-sizing: border-box; display: block; width: 620px; max-width: 100%;\"></a></div></div><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\">Các chuyên gia an ninh sau khi nghiên cứu đã nhận ra OnePlus chưa hề tích hợp tiêu chuẩn bảo mật dữ liệu thẻ thanh toán chung cho website của mình. Nói cách khác, OnePlus đã không đảm bảo được cả những bước bảo vệ cơ bản nhất cho khách hàng.</p><div id=\"admzone474524\" style=\"border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: inherit; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; clear: both; color: rgb(34, 34, 34);\"><div id=\"ads_zone474524\" style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\"><div id=\"ads_zone474524_slot1\" style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: border-box;\"></div></div></div><p style=\"margin-bottom: 25px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 17px; line-height: 25px; font-family: \"Times New Roman\", Georgia, serif; vertical-align: baseline; box-sizing: border-box; color: rgb(34, 34, 34); -webkit-font-smoothing: subpixel-antialiased;\">Về phần những nạn nhân có khả năng cao là mất toàn bộ số tiền đã giao dịch trước đó kia, chẳng có gì nhiều nhặn có thể làm để khắc phục cả. OnePlus chỉ còn biết cách khuyến cáo họ thông báo ngay cho ngân hàng của mình nếu có dấu hiệu tụt giảm tài khoản đủ để xác nhận là một vụ lừa tiền, và hứa sẽ đưa họ vào diện khách hàng ưu tiên trong vòng 1 năm - nghe có vẻ như không phải một món đền bù thỏa đáng lắm nhỉ.</p>                                                ', '');
INSERT INTO `post` (`id`, `title`, `url`, `category`, `datetime`, `image`, `tomtat`, `content`, `trend`) VALUES
(127, 'VueJS & ReactJS – Những chỉ số mới nhất', 'VueJS-&-ReactJS-–-Nhung-chi-so-moi-nhat', 'Javascript', '1516458329', 'http://localhost/blogver2/files/post/photo5a63511755895.png', 'Trong khi đó, Reactjs là một thư viện Javascript dùng để xây dựng giao diện người dùng, và được sử dụng rất nhiều trong thời gian gần đây trong các dự án single-page application.', '<p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\">Hiện nay,&nbsp;<a href=\"https://techtalk.vn/\" data-wpel-link=\"internal\" style=\"box-sizing: border-box; color: rgb(236, 31, 39);\">Vue.js</a>&nbsp;là một trong những framework JavaScript tốt nhất và nhiều người cho rằng Vue sẽ dần thay thế cho Angular và React trong tương lai. Xét vòng đời của mình, Vue.js không&nbsp;mới hơn hay phổ biến hơn so với những frameworks&nbsp;khác nhưng vẫn sở hữu những yếu tố tạo nên sự khác biệt.</p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\">Trong khi đó, Reactjs là một thư viện Javascript dùng để xây dựng giao diện người dùng, và được sử dụng rất nhiều trong thời gian gần đây trong các dự án single-page application.</p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\">Vậy, Vue.js có thực sự tốt hơn so với Angular hay React không? Cùng xem qua 1 vài số liệu và so sánh mới nhất trên thị trường mà&nbsp;<strong style=\"box-sizing: border-box; font-weight: bold;\">anh Việt Trần – CTO của Skylab</strong>&nbsp;chia sẻ tại&nbsp;<a href=\"https://vietnamwebsummit.com/\" data-wpel-link=\"external\" target=\"_new\" style=\"box-sizing: border-box; color: rgb(236, 31, 39);\"><strong style=\"box-sizing: border-box; font-weight: bold;\">Vietnam Web Summit 2017</strong></a>&nbsp;ở Tp.HCM vừa qua.</p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\">Theo thống kê, tính đến thời gian 18/11/2017 thì số lượng Star của VueJS/ Vue đã đạt 74103, Facebook/ React đã cán mốc 81402. Ngược lại, về lượt tải của React xấp xỉ 1,8 triệu/ năm trong khi Vue chỉ ở mức hơn 200 ngàn/ năm.</p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\"><img class=\"alignnone size-full wp-image-25304\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/stat.png\" alt=\"\" width=\"1020\" height=\"198\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/stat.png 1020w, https://static.techtalk.vn/wp-content/uploads/2017/12/stat-300x58.png 300w, https://static.techtalk.vn/wp-content/uploads/2017/12/stat-768x149.png 768w, https://static.techtalk.vn/wp-content/uploads/2017/12/stat-696x135.png 696w\" sizes=\"(max-width: 1020px) 100vw, 1020px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; margin-top: 6px; margin-right: 10px; display: inline-block;\"></p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\">Anh Việt Trần cũng phác họa&nbsp;bức tranh tổng thể về Vue &amp; React thông qua bài toán thực tiễn, dễ hình dung là xây dựng danh sách Shopping trong 2 trường hợp: không có React/Vue &amp; có React/Vue.</p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51); text-align: center;\"><img class=\"alignnone size-full wp-image-25309\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist-1.png\" alt=\"\" width=\"1072\" height=\"778\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist-1.png 1072w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist-1-300x218.png 300w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist-1-768x557.png 768w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist-1-1024x743.png 1024w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist-1-324x235.png 324w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist-1-696x505.png 696w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist-1-1068x775.png 1068w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist-1-579x420.png 579w\" sizes=\"(max-width: 1072px) 100vw, 1072px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; margin-top: 6px; margin-right: 10px; display: inline-block;\"><span style=\"box-sizing: border-box; font-size: 8pt;\">Khi không có Vue/React</span></p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\"><img class=\"alignnone size-full wp-image-25310\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist1-1.png\" alt=\"\" width=\"1013\" height=\"717\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist1-1.png 1013w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist1-1-300x212.png 300w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist1-1-768x544.png 768w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist1-1-100x70.png 100w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist1-1-696x493.png 696w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist1-1-593x420.png 593w\" sizes=\"(max-width: 1013px) 100vw, 1013px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; margin-top: 6px; margin-right: 10px; display: inline-block;\"></p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51); text-align: center;\"><span style=\"box-sizing: border-box; font-size: 8pt;\">Khi có React/Vue thì mọi thứ đều là Virtudal DOM/ Component</span></p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\">Như vậy, mô hình Component trong React &amp; Vue có thể được khái quát như sau:</p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\"><img class=\"alignnone size-full wp-image-25307\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/componentReact-1.png\" alt=\"\" width=\"993\" height=\"436\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/componentReact-1.png 993w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentReact-1-300x132.png 300w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentReact-1-768x337.png 768w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentReact-1-696x306.png 696w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentReact-1-957x420.png 957w\" sizes=\"(max-width: 993px) 100vw, 993px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; margin-top: 6px; margin-right: 10px; display: inline-block;\"></p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51); text-align: center;\"><span style=\"box-sizing: border-box; font-size: 8pt;\">Component trong React</span><img class=\"alignnone size-full wp-image-25308\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/componentVue-1.png\" alt=\"\" width=\"1317\" height=\"709\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/componentVue-1.png 1317w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentVue-1-300x162.png 300w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentVue-1-768x413.png 768w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentVue-1-1024x551.png 1024w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentVue-1-696x375.png 696w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentVue-1-1068x575.png 1068w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentVue-1-780x420.png 780w\" sizes=\"(max-width: 1317px) 100vw, 1317px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; margin-top: 6px; margin-right: 10px; display: inline-block;\"><br style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 8pt;\">Component trong Vue</span></p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\"><a href=\"https://meetup.vn/detail/FRONTEND-NIGHT---NIGHT-OF-REACT-VUE-WEB-LAYOUT-AND-OPTIMIZATION-210\" data-wpel-link=\"external\" target=\"_new\" style=\"box-sizing: border-box; color: rgb(236, 31, 39);\"><img class=\"size-full wp-image-26007 aligncenter\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/event-frontend-night.png\" alt=\"\" width=\"1200\" height=\"628\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/event-frontend-night.png 1200w, https://static.techtalk.vn/wp-content/uploads/2017/12/event-frontend-night-300x157.png 300w, https://static.techtalk.vn/wp-content/uploads/2017/12/event-frontend-night-768x402.png 768w, https://static.techtalk.vn/wp-content/uploads/2017/12/event-frontend-night-1024x536.png 1024w, https://static.techtalk.vn/wp-content/uploads/2017/12/event-frontend-night-696x364.png 696w, https://static.techtalk.vn/wp-content/uploads/2017/12/event-frontend-night-1068x559.png 1068w, https://static.techtalk.vn/wp-content/uploads/2017/12/event-frontend-night-803x420.png 803w\" sizes=\"(max-width: 1200px) 100vw, 1200px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; text-align: center; clear: both; display: block; margin: 6px auto 21px;\"></a></p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\">Đặc biệt, React &amp; Vue cũng sở hữu những điểm khác biệt đáng kể trên nhiều khía cạnh: Create a component, Updating &amp; events, Passing events to children, Two-way data binding, App state for shopping list, Render with iterating, State management.</p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51); text-align: center;\"><img class=\"size-full wp-image-25311 aligncenter\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/create1.png\" alt=\"\" width=\"1185\" height=\"1047\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/create1.png 1185w, https://static.techtalk.vn/wp-content/uploads/2017/12/create1-300x265.png 300w, https://static.techtalk.vn/wp-content/uploads/2017/12/create1-768x679.png 768w, https://static.techtalk.vn/wp-content/uploads/2017/12/create1-1024x905.png 1024w, https://static.techtalk.vn/wp-content/uploads/2017/12/create1-696x615.png 696w, https://static.techtalk.vn/wp-content/uploads/2017/12/create1-1068x944.png 1068w, https://static.techtalk.vn/wp-content/uploads/2017/12/create1-475x420.png 475w\" sizes=\"(max-width: 1185px) 100vw, 1185px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; clear: both; display: block; margin: 6px auto 21px;\"><span style=\"box-sizing: border-box; font-size: 8pt;\">Create a component in React</span><br style=\"box-sizing: border-box;\"><img class=\"size-full wp-image-25312 aligncenter\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/create2.png\" alt=\"\" width=\"1378\" height=\"732\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/create2.png 1378w, https://static.techtalk.vn/wp-content/uploads/2017/12/create2-300x159.png 300w, https://static.techtalk.vn/wp-content/uploads/2017/12/create2-768x408.png 768w, https://static.techtalk.vn/wp-content/uploads/2017/12/create2-1024x544.png 1024w, https://static.techtalk.vn/wp-content/uploads/2017/12/create2-696x370.png 696w, https://static.techtalk.vn/wp-content/uploads/2017/12/create2-1068x567.png 1068w, https://static.techtalk.vn/wp-content/uploads/2017/12/create2-791x420.png 791w\" sizes=\"(max-width: 1378px) 100vw, 1378px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; clear: both; display: block; margin: 6px auto 21px;\"><img class=\"alignnone size-full wp-image-25313\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/renderreact.png\" alt=\"\" width=\"1295\" height=\"1022\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/renderreact.png 1295w, https://static.techtalk.vn/wp-content/uploads/2017/12/renderreact-300x237.png 300w, https://static.techtalk.vn/wp-content/uploads/2017/12/renderreact-768x606.png 768w, https://static.techtalk.vn/wp-content/uploads/2017/12/renderreact-1024x808.png 1024w, https://static.techtalk.vn/wp-content/uploads/2017/12/renderreact-696x549.png 696w, https://static.techtalk.vn/wp-content/uploads/2017/12/renderreact-1068x843.png 1068w, https://static.techtalk.vn/wp-content/uploads/2017/12/renderreact-532x420.png 532w\" sizes=\"(max-width: 1295px) 100vw, 1295px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; margin-top: 6px; margin-right: 10px; display: inline-block;\"><br style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 8pt;\">Create a component in Vue</span><img class=\"alignnone size-full wp-image-25314\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/rendervue.png\" alt=\"\" width=\"1023\" height=\"808\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/rendervue.png 1023w, https://static.techtalk.vn/wp-content/uploads/2017/12/rendervue-300x237.png 300w, https://static.techtalk.vn/wp-content/uploads/2017/12/rendervue-768x607.png 768w, https://static.techtalk.vn/wp-content/uploads/2017/12/rendervue-696x550.png 696w, https://static.techtalk.vn/wp-content/uploads/2017/12/rendervue-532x420.png 532w\" sizes=\"(max-width: 1023px) 100vw, 1023px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; margin-top: 6px; margin-right: 10px; display: inline-block;\"><span style=\"box-sizing: border-box; font-size: 8pt;\">App State for Shopping List</span></p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\">Xét về Performance về Duration in Miliseconds &amp; Memory size, ta lại có những thông số đáng xem xét như:</p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\"><img class=\"alignnone size-full wp-image-25305\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/performance.png\" alt=\"\" width=\"691\" height=\"1305\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/performance.png 691w, https://static.techtalk.vn/wp-content/uploads/2017/12/performance-159x300.png 159w, https://static.techtalk.vn/wp-content/uploads/2017/12/performance-542x1024.png 542w, https://static.techtalk.vn/wp-content/uploads/2017/12/performance-222x420.png 222w\" sizes=\"(max-width: 691px) 100vw, 691px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; margin-top: 6px; margin-right: 10px; display: inline-block;\"><img class=\"alignnone size-full wp-image-25306\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/performance1.png\" alt=\"\" width=\"692\" height=\"281\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/performance1.png 692w, https://static.techtalk.vn/wp-content/uploads/2017/12/performance1-300x122.png 300w\" sizes=\"(max-width: 692px) 100vw, 692px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; margin-top: 6px; margin-right: 10px; display: inline-block;\"></p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51); text-align: right;\"><em style=\"box-sizing: border-box;\"><strong style=\"box-sizing: border-box; font-weight: bold;\">Nguồn:&nbsp;<a href=\"http://techtalk.vn/\" data-wpel-link=\"external\" target=\"_new\" style=\"box-sizing: border-box; color: rgb(236, 31, 39);\">Techtalk</a>&nbsp;via&nbsp;<a href=\"http://blog.topdev.vn/\" data-wpel-link=\"external\" target=\"_new\" style=\"box-sizing: border-box; color: rgb(236, 31, 39);\">TopDev</a></strong></em></p>', ''),
(128, 'VueJS & ReactJS – Những chỉ số mới nhất', 'VueJS-&-ReactJS-–-Nhung-chi-so-moi-nhat', 'Javascript', '1516458329', 'http://localhost/blogver2/files/post/photo5a63511755895.png', 'Trong khi đó, Reactjs là một thư viện Javascript dùng để xây dựng giao diện người dùng, và được sử dụng rất nhiều trong thời gian gần đây trong các dự án single-page application.', '<p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\">Hiện nay,&nbsp;<a href=\"https://techtalk.vn/\" data-wpel-link=\"internal\" style=\"box-sizing: border-box; color: rgb(236, 31, 39);\">Vue.js</a>&nbsp;là một trong những framework JavaScript tốt nhất và nhiều người cho rằng Vue sẽ dần thay thế cho Angular và React trong tương lai. Xét vòng đời của mình, Vue.js không&nbsp;mới hơn hay phổ biến hơn so với những frameworks&nbsp;khác nhưng vẫn sở hữu những yếu tố tạo nên sự khác biệt.</p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\">Trong khi đó, Reactjs là một thư viện Javascript dùng để xây dựng giao diện người dùng, và được sử dụng rất nhiều trong thời gian gần đây trong các dự án single-page application.</p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\">Vậy, Vue.js có thực sự tốt hơn so với Angular hay React không? Cùng xem qua 1 vài số liệu và so sánh mới nhất trên thị trường mà&nbsp;<strong style=\"box-sizing: border-box; font-weight: bold;\">anh Việt Trần – CTO của Skylab</strong>&nbsp;chia sẻ tại&nbsp;<a href=\"https://vietnamwebsummit.com/\" data-wpel-link=\"external\" target=\"_new\" style=\"box-sizing: border-box; color: rgb(236, 31, 39);\"><strong style=\"box-sizing: border-box; font-weight: bold;\">Vietnam Web Summit 2017</strong></a>&nbsp;ở Tp.HCM vừa qua.</p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\">Theo thống kê, tính đến thời gian 18/11/2017 thì số lượng Star của VueJS/ Vue đã đạt 74103, Facebook/ React đã cán mốc 81402. Ngược lại, về lượt tải của React xấp xỉ 1,8 triệu/ năm trong khi Vue chỉ ở mức hơn 200 ngàn/ năm.</p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\"><img class=\"alignnone size-full wp-image-25304\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/stat.png\" alt=\"\" width=\"1020\" height=\"198\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/stat.png 1020w, https://static.techtalk.vn/wp-content/uploads/2017/12/stat-300x58.png 300w, https://static.techtalk.vn/wp-content/uploads/2017/12/stat-768x149.png 768w, https://static.techtalk.vn/wp-content/uploads/2017/12/stat-696x135.png 696w\" sizes=\"(max-width: 1020px) 100vw, 1020px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; margin-top: 6px; margin-right: 10px; display: inline-block;\"></p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\">Anh Việt Trần cũng phác họa&nbsp;bức tranh tổng thể về Vue &amp; React thông qua bài toán thực tiễn, dễ hình dung là xây dựng danh sách Shopping trong 2 trường hợp: không có React/Vue &amp; có React/Vue.</p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51); text-align: center;\"><img class=\"alignnone size-full wp-image-25309\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist-1.png\" alt=\"\" width=\"1072\" height=\"778\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist-1.png 1072w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist-1-300x218.png 300w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist-1-768x557.png 768w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist-1-1024x743.png 1024w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist-1-324x235.png 324w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist-1-696x505.png 696w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist-1-1068x775.png 1068w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist-1-579x420.png 579w\" sizes=\"(max-width: 1072px) 100vw, 1072px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; margin-top: 6px; margin-right: 10px; display: inline-block;\"><span style=\"box-sizing: border-box; font-size: 8pt;\">Khi không có Vue/React</span></p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\"><img class=\"alignnone size-full wp-image-25310\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist1-1.png\" alt=\"\" width=\"1013\" height=\"717\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist1-1.png 1013w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist1-1-300x212.png 300w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist1-1-768x544.png 768w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist1-1-100x70.png 100w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist1-1-696x493.png 696w, https://static.techtalk.vn/wp-content/uploads/2017/12/shoppinglist1-1-593x420.png 593w\" sizes=\"(max-width: 1013px) 100vw, 1013px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; margin-top: 6px; margin-right: 10px; display: inline-block;\"></p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51); text-align: center;\"><span style=\"box-sizing: border-box; font-size: 8pt;\">Khi có React/Vue thì mọi thứ đều là Virtudal DOM/ Component</span></p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\">Như vậy, mô hình Component trong React &amp; Vue có thể được khái quát như sau:</p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\"><img class=\"alignnone size-full wp-image-25307\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/componentReact-1.png\" alt=\"\" width=\"993\" height=\"436\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/componentReact-1.png 993w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentReact-1-300x132.png 300w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentReact-1-768x337.png 768w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentReact-1-696x306.png 696w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentReact-1-957x420.png 957w\" sizes=\"(max-width: 993px) 100vw, 993px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; margin-top: 6px; margin-right: 10px; display: inline-block;\"></p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51); text-align: center;\"><span style=\"box-sizing: border-box; font-size: 8pt;\">Component trong React</span><img class=\"alignnone size-full wp-image-25308\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/componentVue-1.png\" alt=\"\" width=\"1317\" height=\"709\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/componentVue-1.png 1317w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentVue-1-300x162.png 300w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentVue-1-768x413.png 768w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentVue-1-1024x551.png 1024w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentVue-1-696x375.png 696w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentVue-1-1068x575.png 1068w, https://static.techtalk.vn/wp-content/uploads/2017/12/componentVue-1-780x420.png 780w\" sizes=\"(max-width: 1317px) 100vw, 1317px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; margin-top: 6px; margin-right: 10px; display: inline-block;\"><br style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 8pt;\">Component trong Vue</span></p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\"><a href=\"https://meetup.vn/detail/FRONTEND-NIGHT---NIGHT-OF-REACT-VUE-WEB-LAYOUT-AND-OPTIMIZATION-210\" data-wpel-link=\"external\" target=\"_new\" style=\"box-sizing: border-box; color: rgb(236, 31, 39);\"><img class=\"size-full wp-image-26007 aligncenter\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/event-frontend-night.png\" alt=\"\" width=\"1200\" height=\"628\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/event-frontend-night.png 1200w, https://static.techtalk.vn/wp-content/uploads/2017/12/event-frontend-night-300x157.png 300w, https://static.techtalk.vn/wp-content/uploads/2017/12/event-frontend-night-768x402.png 768w, https://static.techtalk.vn/wp-content/uploads/2017/12/event-frontend-night-1024x536.png 1024w, https://static.techtalk.vn/wp-content/uploads/2017/12/event-frontend-night-696x364.png 696w, https://static.techtalk.vn/wp-content/uploads/2017/12/event-frontend-night-1068x559.png 1068w, https://static.techtalk.vn/wp-content/uploads/2017/12/event-frontend-night-803x420.png 803w\" sizes=\"(max-width: 1200px) 100vw, 1200px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; text-align: center; clear: both; display: block; margin: 6px auto 21px;\"></a></p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51);\">Đặc biệt, React &amp; Vue cũng sở hữu những điểm khác biệt đáng kể trên nhiều khía cạnh: Create a component, Updating &amp; events, Passing events to children, Two-way data binding, App state for shopping list, Render with iterating, State management.</p><p style=\"box-sizing: border-box; font-family: Roboto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51); text-align: center;\"><img class=\"size-full wp-image-25311 aligncenter\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/create1.png\" alt=\"\" width=\"1185\" height=\"1047\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/create1.png 1185w, https://static.techtalk.vn/wp-content/uploads/2017/12/create1-300x265.png 300w, https://static.techtalk.vn/wp-content/uploads/2017/12/create1-768x679.png 768w, https://static.techtalk.vn/wp-content/uploads/2017/12/create1-1024x905.png 1024w, https://static.techtalk.vn/wp-content/uploads/2017/12/create1-696x615.png 696w, https://static.techtalk.vn/wp-content/uploads/2017/12/create1-1068x944.png 1068w, https://static.techtalk.vn/wp-content/uploads/2017/12/create1-475x420.png 475w\" sizes=\"(max-width: 1185px) 100vw, 1185px\" style=\"box-sizing: border-box; border: 0px; max-width: 100%; height: auto; clear: both; display: block; margin: 6px auto 21px;\"><span style=\"box-sizing: border-box; font-size: 8pt;\">Create a component in React</span><br style=\"box-sizing: border-box;\"><img class=\"size-full wp-image-25312 aligncenter\" src=\"https://static.techtalk.vn/wp-content/uploads/2017/12/create2.png\" alt=\"\" width=\"1378\" height=\"732\" srcset=\"https://static.techtalk.vn/wp-content/uploads/2017/12/create2.png 1378w, https://static.techtalk.vn/wp-content/uploads/2017/12/create2-300x159.png 300w, https://static.techtalk.vn/wp-content/uploads/2017/12/create2-768x408.png 768w, https://static.techtalk.vn/wp-content/uploads/2017/12/create2-1024x544.pn