oto; font-size: 16px; line-height: 26px; margin-bottom: 26px; color: rgb(51, 51, 51); text-align: right;\"><em style=\"box-sizing: border-box;\"><strong style=\"box-sizing: border-box; font-weight: bold;\">Nguồn:&nbsp;<a href=\"http://techtalk.vn/\" data-wpel-link=\"external\" target=\"_new\" style=\"box-sizing: border-box; color: rgb(236, 31, 39);\">Techtalk</a>&nbsp;via&nbsp;<a href=\"http://blog.topdev.vn/\" data-wpel-link=\"external\" target=\"_new\" style=\"box-sizing: border-box; color: rgb(236, 31, 39);\">TopDev</a></strong></em></p>', '');
