(23, 'Kamisama Hajimemashita', 'http://st.thichtruyentranh.com/images/icon/0019/kamisama-hajimemashita1432383229.jpg', 'http://thichtruyentranh.com/truyen/2016/07/kamisama-hajimemashita/83.html', 'Cha của Momozono Nanami - một người đàn ông có máu ham mê cờ bạc - đã biến mất sau khi mắc phải một món nợ lớn.Vậy nên, Nanami bị những người đòi nợ đuổi ra khỏi nhà.Tình cờ, cô gặp một người đàn ông kì lạ đang bị chó rượt, ông ta bảo sẽ cho cô căn nhà của mình.Nanami đã tin vào lời thuyết phục ấy.Nhưng khi đến nơi, căn nhà... hóa ra lại là một đền thần.Và mọi chuyện càng rắc rối hơn nữa khi một kẻ có đôi tai cáo xuất hiện...', 0);
